script: |
  super -f text -I q3686.spq | sort > q3686.out

inputs:
  - name: q3686.spq
    data: |
      SELECT 92 + - col1 + - + col2 + + col2 + + 30 * 54 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NOT ( ( ( - 23 + - col2 / + + col2 IN ( - + col1 + + - col0, - col2, - col0 ) ) ) ) );
  - name: tab1

outputs:
  - name: q3686.out
    data: |
      1665
      1698
      1707
